// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import AdminLogin from './components/Admin/AdminLogin';
import TenantLogin from './components/Tenant/TenantLogin';
import TenantDashboard from './components/Admin/TenantDashboard';
import VehicleDashboard from './components/Tenant/VehicleDashboard';

const App = () => {
    return (
        <Router>
            <Switch>
                <Route path="/admin/login" component={AdminLogin} />
                <Route path="/tenant/login" component={TenantLogin} />
                <Route path="/admin/dashboard" component={TenantDashboard} />
                <Route path="/tenant/:tenantId/vehicles" component={VehicleDashboard} />
                <Route path="/" exact>
                    <h1>Welcome to the Vehicle Management System</h1>
                </Route>
            </Switch>
        </Router>
    );
};

export default App;
